import React from "react";
import PageLayout from "src/Layouts/PageLayout";
import { sections } from "src/constants/work";

const Work = () => {
  return (
    <PageLayout>
      <main className="flex flex-col flex-grow gap-20 px-32 mx-10 mb-10 border-x-2 border-black overflow-auto">
        <h4 className="grid py-20 text-8xl tracking-wider font-medium border-b border-black">
          Uno.ai
        </h4>

        <p>
          A compound AI system to radically transform your GRC program from
          tedious, cumbersome, and time taking workflows to a fast and scalable
          AI native reality. Uno's domain specific compound AI system scales and
          outperforms generic language models to deliver the accuracy,
          resiliency, scale, speed, and assurance that enterprises need.
        </p>

        <ul className="flex flex-col flex-grow gap-5">
          {sections.map((section, sectionIndex) => {
            return (
              <li key={sectionIndex} className="grid md:grid-cols-2 gap-10">
                <article className="border-t-2 border-black">
                  <h4 className="text-4xl">{section.section_name}</h4>
                  <p className="text-2xl">{section.section_description}</p>
                </article>
                <article className="flex flex-col flex-grow">
                  {section.features.map((feature, featureIndex) => {
                    return (
                      <article
                        key={featureIndex}
                        className="grid gap-2 py-5 border-t-2 border-black"
                      >
                        <h4 className="text-2xl">{feature.feature_name}</h4>
                        <p>{feature.feature_description}</p>
                      </article>
                    );
                  })}
                </article>
              </li>
            );
          })}
        </ul>
      </main>
    </PageLayout>
  );
};

export default Work;
